Mehdi Chamanara (, born April 14, 1987) is an Iranian &lt;a href="soccer"&gt;football&lt;/a&gt; player who currently plays for &lt;a href="Foolad%20F.C."&gt;Foolad F.C.&lt;/a&gt; of the &lt;a href="Persian%20Gulf%20Cup"&gt;IPL&lt;/a&gt;.
Club career.
Chamanara joined &lt;a href="Foolad%20F.C."&gt;Foolad&lt;/a&gt; in 2009 after spending the previous two seasons at &lt;a href="Malavan%20F.C."&gt;Malavan F.C.&lt;/a&gt;
